INSERT INTO `sb_page` VALUES(160, '3.b.2.1', 'Instructions for Filing a Leave Buy-Back', '<P class=MsoNormal>All below referenced forms have attached clearly marked instructions for both the employee and supervisor.<SPAN>&nbsp; </SPAN>Each party should read these instructions and under-stand what is being asked before completing his or portion of the claim forms.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal>Forms Needed<U><o:p></o:p></U></P>\r\n<P class=MsoNormal style=\\"TEXT-ALIGN: center\\" align=center><U><o:p><SPAN style=\\"TEXT-DECORATION: none\\">&nbsp;</SPAN></o:p></U></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 1.5in; TEXT-INDENT: -1.5in\\">Form <A href=\\"http://www.dol.gov/esa/regs/compliance/owcp/ca-7.pdf\\"><U><SPAN style=\\"COLOR: blue\\">CA-7</SPAN></U>:</A><SPAN>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Claim for Compensation on Account of Traumatic Injury or Occupational Disease<o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 1.5in; TEXT-INDENT: -1.5in\\">Form <U><SPAN style=\\"COLOR: blue\\">CA-20</SPAN></U>:<SPAN>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Attending Physician?s Report<o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class%3', NULL, NULL);
INSERT INTO `sb_page` VALUES(161, '3.b.2.1', 'Instructions for Filing a Leave Buy-Back', '<P class=MsoNormal>All below referenced forms have attached clearly marked instructions for both the employee and supervisor.<SPAN>&nbsp; </SPAN>Each party should read these instructions and under-stand what is being asked before completing his or portion of the claim forms.<?xml:namespace prefix = o /><o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal>Forms Needed<U><o:p></o:p></U></P>\r\n<P class=MsoNormal style=\\"TEXT-ALIGN: center\\" align=center><U><o:p><SPAN style=\\"TEXT-DECORATION: none\\">&nbsp;</SPAN></o:p></U></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 1.5in; TEXT-INDENT: -1.5in\\">Form <U><SPAN style=\\"COLOR: blue\\"><A href=\\"http://learningfox.com/storyboard/display.php\\">CA-7</A></SPAN></U>:<SPAN>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Claim for Compensation on Account of Traumatic Injury or Occupational Disease<o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal style=\\"MARGIN-LEFT: 1.5in; TEXT-INDENT: -1.5in\\">Form <U><SPAN style=\\"COLOR: blue\\">CA-20</SPAN></U>:<SPAN>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN>Attending Physician?s Report<o:p></o:p></P>\r\n<P class=MsoNormal><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal st', NULL, NULL);
INSERT INTO `sb_page` VALUES(162, 'x', 'Benefits Coordinator/HR Specialist?s Responsibilities Checklist', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n<li>Upon receipt of claim form from supervisor, review for accuracy and completeness.</li>\r\n\r\n<li>Contact employee?s supervisor to discuss specifics of case: possibility of controversion/challenge, employee duty status, receipt of medical evidence, supervisor responsibilities, etc.</li>\r\n\r\n<li>Review case file at regularly scheduled intervals.  Contact supervisor, employee, and OWCP where appropriate to determine duty status, current medical documentation, pending adjudicative and case management issues, etc.  In conjunction with the supervisor, send Form CA-17, Duty Status Report, to employee?s physician if no current medical evidence is received stating anticipated return to work date and current work tolerance limitations.</li>\r\n\r\n<li>If COP is to be terminated, advise timekeeper to convert timecards.</li>\r\n\r\n<li>If employee enters LWOP status, review CA-7 for accuracy and completeness and immediately submit to OWCP for processing. </li>\r\n\r\n<li>Track case status, payment of medical bills and compensation payments, and other important case information in AQS.</li>\r\n\r\n\r\n<li>If medical evidence shows employee is capable of working in a limited duty capacity, contact supervisor to determine if a transitional work assignment (light duty) can be provided.  If not, contact OWCP and request vocational rehabilitation services.  If medical evidence is missing or insufficient to establish ongoing disability from employment, contact OWCP and request a second opinion evaluation. </li>\r\n\r\n<li>Maintain contact with supervisor, employee, and OWCP until such as employee returns to duty, or OWCP determines that employee is not expected to return.</li>\r\n\r\n<li>Send copies of CA-1 and CA-2 to the Benefits Division.</li>\r\n\r\n</ul>\r\n<p>H.        Employee?s Responsibilities Checklist</p>\r\n\r\n\r\n<ul>\r\n<li>Report all injuries promptly to supervisor.</li>\r\n\r\n\r\n<li>File Form CA-1 if employee wishes to file a traumatic injury claim.  (If employee wants to claim Continuation of Pay (COP), employee must file Form CA-1 within 30 days of the date of injury and must provide supportive medical evidence to his or her supervisor within the first 10 days of receiving COP.)</li>\r\n\r\n\r\n<li>File Form CA-2 if employee wishes to file an occupational disease claim.</li>\r\n\r\n<li>Provide evidence to support his or her claim.</li>\r\n\r\n<li>Inquire with attending physician about possibility to work in a light duty capacity (transitional work assignment).</li>\r\n\r\n <li>Keep supervisor informed about medical status with regular reports from attending physician.</li>\r\n\r\n<li>Return to work within medical restrictions when possible.</li>\r\n</ul>', NULL, NULL);
INSERT INTO `sb_page` VALUES(163, 'x', 'Instructions Regarding the CA-20', '<p>On the back of the CA-20, there is a clearly marked set of instructions for the \r\n physician to follow.  The physician should read these instructions and understand \r\nwhat is being asked before completing his or her portion of the form.</p>\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(164, '5.0.1', 'Benefits Coordinator/HR Specialist?s Responsibilities Checklist', '\r\n<ul>\r\n<li>Upon receipt of claim form from supervisor, review for accuracy and completeness.</li>\r\n\r\n<li>Contact employee?s supervisor to discuss specifics of case: possibility of controversion/challenge, employee duty status, receipt of medical evidence, supervisor responsibilities, etc.</li>\r\n\r\n<li>Review case file at regularly scheduled intervals.  Contact supervisor, employee, and OWCP where appropriate to determine duty status, current medical documentation, pending adjudicative and case management issues, etc.  In conjunction with the supervisor, send Form CA-17, Duty Status Report, to employee?s physician if no current medical evidence is received stating anticipated return to work date and current work tolerance limitations.</li>\r\n\r\n<li>If COP is to be terminated, advise timekeeper to convert timecards.</li>\r\n\r\n<li>If employee enters LWOP status, review CA-7 for accuracy and completeness and immediately submit to OWCP for processing. </li>\r\n\r\n<li>Track case status, payment of medical bills and compensation payments, and other important case information in AQS.</li>\r\n\r\n\r\n<li>If medical evidence shows employee is capable of working in a limited duty capacity, contact supervisor to determine if a transitional work assignment (light duty) can be provided.  If not, contact OWCP and request vocational rehabilitation services.  If medical evidence is missing or insufficient to establish ongoing disability from employment, contact OWCP and request a second opinion evaluation. </li>\r\n\r\n<li>Maintain contact with supervisor, employee, and OWCP until such as employee returns to duty, or OWCP determines that employee is not expected to return.</li>\r\n\r\n<li>Send copies of CA-1 and CA-2 to the Benefits Division.</li>\r\n\r\n</ul>\r\n<p>H.        Employee?s Responsibilities Checklist</p>\r\n\r\n\r\n<ul>\r\n<li>Report all injuries promptly to supervisor.</li>\r\n\r\n\r\n<li>File Form CA-1 if employee wishes to file a traumatic injury claim.  (If employee wants to claim Continuation of Pay (COP), employee must file Form CA-1 within 30 days of the date of injury and must provide supportive medical evidence to his or her supervisor within the first 10 days of receiving COP.)</li>\r\n\r\n\r\n<li>File Form CA-2 if employee wishes to file an occupational disease claim.</li>\r\n\r\n<li>Provide evidence to support his or her claim.</li>\r\n\r\n<li>Inquire with attending physician about possibility to work in a light duty capacity (transitional work assignment).</li>\r\n\r\n <li>Keep supervisor informed about medical status with regular reports from attending physician.</li>\r\n\r\n<li>Return to work within medical restrictions when possible.</li>\r\n</ul>\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(165, '5.1.1', 'Points to Remember Regarding a CA-16', '<ul>\r\n<li>Special care must be exercised in issuing this form since ?authorization? guarantees payment of medical bills for up to 60 days.</li>\r\n\r\n<li>The CA-16 must be made available to the employee for treatment if requested.  The authorizing official should not issue a CA-16 if more than a week has passed since the injury.  In cases of emergency medical where there was no time to issue a CA-16, the form should be completed by the designated official and mailed within 48 hours to the facility providing care.  No CA-16 should be issued retroactive for treatment except in emergency situations.</li>\r\n</ul>\r\n\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(166, '5.1.2', 'Instructions for the CA-17', '<p><b>Instructions Regarding the CA-17:</B></p>\r\n\r\n \r\n\r\n<p>On the back of the CA-17, there is a clearly marked set of instructions for the \r\n\r\n \r\n\r\nsupervisor and for the physician.  Each party should read these instructions and\r\n\r\n \r\n\r\nunderstand what is being asked before completing his or her portion of the claim\r\n\r\n \r\n\r\nform.</p>\r\n\r\n \r\n\r\n \r\n\r\n<p>The Court Unit should use Form CA-17, Duty Status Report to obtain interim\r\n\r\n\r\n\r\nmedical reports concerning the employee?s fitness for duty.  It may be issued \r\n\r\n \r\n\r\ninitially with Form CA-16.\r\n</p>\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(167, '5.1.3', 'Points to Remember Regarding a CA-17 ', '<p><b>Points to Remember Regarding a CA-17</b></p>\r\n\r\n \r\n\r\n<ul>\r\n<li>The supervisor may send Form CA-17 to the physician at reasonable\r\n\r\nintervals (but not more than once every two weeks) to monitor the employee?s medical status and ability to return to light or full duty.</li>\r\n\r\n \r\n\r\n<li>It is not necessary to use this form with every injured employee.  In most \r\n\r\ncases Form CA-20 is sufficient.  Form Ca-17is most useful and effective when returning an employee back to work.</li>\r\n</ul>\r\n\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(168, '2.c.1', 'Instructions for the CA-2a', '\r\n<p>&nbsp;</p>\r\n<P><STRONG>Recurrence</STRONG></P>\r\n<p>&nbsp;</p>\r\n<P><STRONG>Employee (or person acting on the employee?s behalf):</STRONG></P>\r\n<UL>\r\n<LI>Review the definition of recurrence on the instruction part of the form.&nbsp; If the circumstances meet the ?spontaneous return? or ?medical treatment? definition, then complete the CA-2a.&nbsp; If a new incident or injury occurs which precipitates the disability, even if the injury is to the same part of the body previously injured or is new exposure to the same cause (s) of a previously suffered occupational disease, this constitutes a new injury and Form CA-1 or CA-2 should be filed accordingly. \r\n<LI>Complete the Employee?s portion of the CA-2a (part A) completely. \r\n<LI>Give the original date of injury and claim number assigned by the Office of Workers? Compensation Programs (OWCP). \r\n<LI>Provide detailed information and bridging medical evidence regarding the recurrence.&nbsp; Detailed information may be written on a separate sheet of paper if necessary, explaining why you believe your present condition is related to the original injury. &nbsp; Provide bridging medical evidence that shows the relationship between the original injury and your current medical status. \r\n<LI>Describe all injuries and illnesses which you suffered between the date you returned to work following the original injury, and the date of the recurrence. &nbsp; Arrange for the submission of all relevant medical records.&nbsp; In the details, note if you have changed your place of residence or treating physicians since the original injury. \r\n<LI>Provide dates of medical treatment following recurrence.&nbsp; If treated by other physicians after returning to work following the original injury, similar medical reports should be obtained from each treating physician. \r\n<', NULL, NULL);
INSERT INTO `sb_page` VALUES(169, '5.1.4', 'Instructions for the CA-915 ', '<p><b>Instructions Regarding the CA-915</b></p>\r\n\r\n \r\n<ol type=''1''>\r\n\r\n<li>Pharmacy?s name, address and tax identification number.</li>\r\n<li>Claimant?s name, address and OWCP claim number.</li>\r\n<li>Name of physician who prescribed the drug.</li>\r\n<li>Eleven digit national drug code.</li>\r\n<li>Date filled.</li>\r\n<li>Name of drug and strength.</li>\r\n<li>Quantity.</li>\r\n<li>New prescription or refill number.</li>\r\n<li>Amount paid by claimant.</li>\r\n</ol>\r\n \r\n\r\n<p><b>Prescription Bills</b></p>\r\n\r\n \r\n\r\n<p>Prescription receipts must include the name of the drug, name of physician, price of the prescription, and the date the prescription was filled.  </p>\r\n \r\n\r\n<p><b>Instructions Regarding Prescription Bills</b></p>\r\n\r\n \r\n<ol type=''1''>\r\n\r\n<li>Tape the prescription receipt and cash register receipt to an 8 ? x 11 sheet of paper.</li>\r\n<li>Type outgoing letter and franked envelope to the appropriate OWCP office.   Type the statement: ?A prescription receipt in the total amount of $_____________ is enclosed.  Please reimburse employee for this amount.? </li>\r\n<li>Mail the Form CA-915 (Claimant Medical Reimbursement Form) along with \r\nthe prescription receipts securely attached to the U.S. Department of Labor<br>\r\n\r\n       DFEC Central Mailroom<br>\r\n\r\n       P.O. Box 8300         <br>\r\n\r\n       London, KY 40742-8300</li>\r\n<ol>\r\n\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(170, '5.1.5', 'Points to Remember Regarding a CA-915 ', '<p>Points to Remember Regarding a Prescription</p>\r\n<ul>\r\n <li>Make sure that along with the CA-915, you also attach proof of payment.</li>\r\n<li>If the CA-915 is not being submitted with the initial claim, make sure that the OWCP Number is on every page.</li>\r\n</ul>\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(171, '5.1.6', 'Instructions for the HCFA-1500 ', '<p>The HCFA-1500 has attached clearly marked set of instructions for physician to \r\n follow.  The physician should read these instructions and understand what is being\r\n asked before completing his/her portion of the claim form.</p>\r\n<p>To be accepted for payment, the bill must include the following information:</p>\r\n<ol type=''1''>\r\n<li>Employee?s name.</li>\r\n<li>Provider?s name, address and telephone number.</li>\r\n<li>Diagnosis.</li>\r\n<li>Itemized list of services with charges.  The Current Procedural Terminology<br>\r\n\r\n\r\n (CPT) code for each medical, surgical, x-ray or laboratory service should be shown on the HCFA-1500, and bills should show the dates when their services or\r\n\r\nsupplies were furnished. </li>\r\n\r\n<li>Tax identification number (the provider?s employer identification number or\r\n\r\nsocial security number).</li>\r\n\r\n \r\n</ol>\r\n\r\n<p>NOTE:             Provide the employee with a return business envelope so that the \r\n\r\nphysician can send the completed form to the field office.  The \r\n\r\n          Benefits Coordinator/HR Specialist should send the original to the\r\n\r\nDepartment of Labor and retain a copy for the court unit?s file. </p>\r\n\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(172, '5.1.7', 'Points to Remember Regarding a HCFA-1500 ', '<p><b>Points to Remember Regarding a HCFA-1500</b></p>\r\n\r\n \r\n<ul>\r\n<li>The following providers are required to use Form HCFA-1500 to submit \r\n\r\nbills: physicians; nursing services; laboratories and x-ray facilities; chiropractors;\r\n\r\ntherapists, and suppliers of medical equipment and goods.  The following providers are encouraged, though not required to use the HCFA-1500: dentists (may use standard ADA form); and pharmacists (may use standard pharmacy billing form).\r\n</li>\r\n \r\n<li>The Department of Labor (DOL) is responsible for payment of all \r\n\r\nreasonable charges stemming from covered medical services to the injured employee.  The DOL employs a fee schedule and other tests to determine charge reasonableness.  Schedule limits are applied to procedures identified through an automated billing system, by code, corresponding to the AMA Physician?s Current Procedural Terminology (CPT).\r\n</li>\r\n \r\n\r\n<li>An employee who has paid a provider may request reimbursement by \r\n\r\nsubmitting a completed HCFA-1500 signed by the provider and completing Form CA-915 (Claimant Medical Reimbursement Form).\r\n</li>\r\n \r\n<li>The employee should advise medical providers that his or her injury is  \r\n\r\nwork-related and to submit bills for service to the employee?s?s court unit address.  The Benefits Coordinator/HR Specialist will forward the bills to DOL.  Sometimes the bills are forwarded to the employee?s health insurance carrier.  The carrier may request reimbursement for its charges by submitting a completed HCFA-1500.  The form should list procedures and charges for each provider and copies of paid bills and cancelled checks should be attached.  It should include the carrier?s Tax Identification Number.\r\n</li>\r\n</ul>\r\n\r\n<p><b>Medical Bills That Are Not On A HCFA-1500</b></p>\r\n\r\n \r\n\r\n<p>When you receive a medical bill that is not on a HCFA-1500, you should do the \r\n\r\n \r\n\r\nfollowing:</p>\r\n\r\n \r\n<ol type=''1''>\r\n<li>Type a ?franked? self-addressed envelope with your court unit address on it.</li>\r\n<li>Staple the incoming medical bill, the self-addressed envelope, a blank\r\n\r\nHCFA-1500 and a pre-typed note.  (The pre-typed note should state: ?Gentlemen:  The enclosed medical bill is being returned to be placed on the attached Form HCFA-1500.  Please complete the attached form and return in the enclosed self-addressed envelope.  Once we have received this form, we will submit it to the U.S. Department of Labor for payment.  Thank You.?)\r\n</li>\r\n<li>Type a ?franked? enveloped to the medical facility.</li>\r\n<li>Make a copy of the bill, and write on it ?Returned to be placed on HCFA-\r\n1500", then initial and date the comment.</li>\r\n<li>Staple to the left side of the case folder.  (When the requested correction \r\narrives back in your office, you may destroy the copy you are holding.)</li>\r\n</ol>\r\n \r\n\r\n<p>If a hospital bill is not itemized, follow the same instructions above.</p>\r\n\r\n\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(174, '1', 'Checklist for Employee', '\r\n<p>&nbsp;</p>\r\n<p>Employee''s Responsibilities Checklist<p>\r\n\r\n<ul>\r\n<li>Report all injuries promptly to supervisor.</li>\r\n<li>File Form CA-1 if employee wishes to file a traumatic injury claim.  (If employee wants to claim Continuation of Pay (COP), employee must file Form CA-1 within 30 days of the date of injury and must provide supportive medical evidence to his or her supervisor within the first 10 days of receiving COP.)</li>\r\n<li>File Form CA-2 if employee wishes to file an occupational disease claim.</li>\r\n<li>Provide evidence to support his or her claim.</li>\r\n<li>Inquire with attending physician about possibility to work in a light duty capacity (transitional work assignment).</li>\r\n<li>Keep supervisor informed about medical status with regular reports from attending physician.</li>\r\n<li>Return to work within medical restrictions when possible.</li>\r\n</ul>', NULL, NULL);
INSERT INTO `sb_page` VALUES(175, '1', 'Coordinator/HR Specialist Checklist ', '<p>&nbsp;</p>\r\n<p>Benefits Coordinator/HR Specialist''s Responsibilities Checklist</p>\r\n<ul>\r\n<li>Upon receipt of claim form from supervisor, review for accuracy and completeness.</li>\r\n<li>Contact employee''s supervisor to discuss specifics of case: possibility of controversion/challenge, employee duty status, receipt of medical evidence, supervisor responsibilities, etc.</li>\r\n<li>Review case file at regularly scheduled intervals.  Contact supervisor, employee, and OWCP where appropriate to determine duty status, current medical documentation, pending adjudicative and case management issues, etc.  In conjunction with the supervisor, send Form CA-17, Duty Status Report, to employee''s physician if no current medical evidence is received stating anticipated return to work date and current work tolerance limitations.</li>\r\n<li>If COP is to be terminated, advise timekeeper to convert timecards.</li>\r\n<li>If employee enters LWOP status, review CA-7 for accuracy and completeness and immediately submit to OWCP for processing.  </li>\r\n<li>Track case status, payment of medical bills and compensation payments, and other important case information in AQS.</li>\r\n<li>If medical evidence shows employee is capable of working in a limited duty capacity, contact supervisor to determine if a transitional work assignment (light duty) can be provided.  If not, contact OWCP and request vocational rehabilitation services.  If medical evidence is missing or insufficient to establish ongoing disability from employment, contact OWCP and request a second opinion evaluation.  </li>\r\n<li>Maintain contact with supervisor, employee, and OWCP until such as employee returns to duty, or OWCP determines that employee is not expected to return.</li>\r\n<li>Send copies of CA-1 and CA-2 to the Benefits Division.</li>\r\n</ul>', NULL, NULL);
INSERT INTO `sb_page` VALUES(176, '1', 'Checklist for Supervisor', '<p>&nbsp;</p>\r\n<p>Supervisor''s Responsibilities Checklist</p>\r\n<ul>\r\n<li>Review employee''s allegations, witness statements, and other circumstances surrounding the alleged injury/illness and consider whether controversion/challenge is appropriate.  If so, gather all relevant information and associate it with the claim form.</li>\r\n<li>Complete agency portion of Form CA-1 or Form CA-2.</li>\r\n<li>In traumatic injury cases, authorize medical treatment with Form CA-16.  Advise employee of the right to elect COP if employee is disabled and if one of the nine reasons for controverting COP is not relevant.  If COP is being controverted, advise employee and prepare a detailed narrative statement to send to OWCP.</li>\r\n<li>Forms CA-1 and or CA-2 must be submitted to OWCP within 10 workdays upon receipt from the injured/ill employee.</li>\r\n<li>If employee is using COP, ensure medical documentation supporting disability due to the alleged injury is received within 10 workdays of the injury.  If not COP should be terminated.  </li>\r\n<li>If employee enters a LWOP status, advise employee to complete Form \r\nCA-7, for wage loss compensation.  Upon receipt from employee, complete\r\nagency section of the form for submission to OWCP.</li>\r\n<li>While employee remains out of work, initiate contact on a weekly basis.  This contact should be of a non-threatening, information gathering call.  Inquire as to employee''s progress, medical status, and ability to return to both full and limited duty.  Advise employee that you will provide whatever assistance you can to aid in the recovery process.  </li>\r\n<li>If medical evidence states that employee is capable of working with restrictions, make every effort to offer the employee a transitional work assignment that meets his work limitations or discuss vocational rehabilitation options at OWCP.</li>\r\n<li>Cooperate with OWCP claims examiners, nurse case managers and vocational rehabilitation specialists should they contact you.  </li>\r\n<li>Should you have any questions or concerns regarding your employee, arrange to speak with the Benefits Division.  </li>\r\n</ul>\r\n', NULL, NULL);
INSERT INTO `sb_page` VALUES(177, '0', 'Orientation', '<p>This  is your Table of Contents. It allows you to see the entire course and to select  any Chapter or Topic at any point during the training. </p>\r\n<p>&nbsp;</p>\r\n<p>These  links at the top allow you to access FAQs, Forms referenced in this training, a  Glossary and you can Search for a topic by entering your information then  clicking GO.</p>\r\n<p>&nbsp;</p>\r\n<p>This  drop-down box will allow you to travel to any Chapter and Topic at any time.</p>\r\n<p>&nbsp;</p>\r\n<p>This  is your content area. It will present content based on your location in the  course.</p>\r\n<p>&nbsp;</p>\r\n<p>These  are your navigation buttons. They allow you to navigate through the course by  simply selecting &ldquo;Back&rdquo; and &ldquo;Next&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>If  you&rsquo;d like to review this Orientation again, <strong><a href=\\"#\\" onClick=\\"document.audios.SetVariable(''restart'', ''xx'');\\">click here</a>.</strong> </p>\r\n<p>&nbsp;</p>\r\n<p align="center"><strong>Let&rsquo;s get started. </strong></p>\r\n\r\n\r\n<p><strong>Go ahead and click the START button to begin.</strong></p>', NULL, NULL);
INSERT INTO `sb_page` VALUES(178, '1', 'Compensation Schedule', '<table cellspacing="0" cellpadding="3" border="0">\r\n  <col width="295" />\r\n  <col width="231" />\r\n  <tr height="25">\r\n    <td height="25" width="295"><div align="left">MEMBER</div></td>\r\n    <td width="231"><div align="left">WEEKS</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Arm</div></td>\r\n    <td align="right"><div align="left">312</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Leg</div></td>\r\n    <td align="right"><div align="left">288</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Hand</div></td>\r\n    <td align="right"><div align="left">244</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Foot</div></td>\r\n    <td align="right"><div align="left">205</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Eye</div></td>\r\n    <td align="right"><div align="left">160</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Thumb</div></td>\r\n    <td align="right"><div align="left">75</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">First Finger</div></td>\r\n    <td align="right"><div align="left">46</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Great Toe</div></td>\r\n    <td align="right"><div align="left">38</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Second Finger</div></td>\r\n    <td align="right"><div align="left">30</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Third Finger</div></td>\r\n    <td align="right"><div align="left">25</div></td>\r\n  </tr>\r\n  <tr height="25">\r\n    <td height="25"><div align="left">Toe (other than great toe)</div></td>\r\n    <td align="right"><div align="left">16</div></td>\r\n  </tr>\