INSERT INTO `sb_question` VALUES(1, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>One of the benefits of FECA is payment of your medical bills resulting from your injury.</P>\r\n', 18);
INSERT INTO `sb_question` VALUES(2, '<BR>\r\n<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>All judiciary employees are covered immediately by the FECA, regardless of whether they are permanent or temporary, full-time or part-time.</p>\r\n', 19);
INSERT INTO `sb_question` VALUES(3, '<br>\r\n<p><i><b>Question 3:</b></i></p>\r\n\r\n<p>Employees are eligible for coverage by FECA:</p>\r\n', 20);
INSERT INTO `sb_question` VALUES(4, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>A Benefits Coordinator for the 4th Circuit sustains a fractured left middle finger when she closes the office door on her left hand.  What type of claim should she file and what form should be issued to initiate a claim?</p>\r\n<p>CA-1, Traumatic injury. The injury happened as the result of a single event in a single day. Is this answer, True or False?</p>', 73);
INSERT INTO `sb_question` VALUES(5, '<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>A Procurement Specialist drops a box of papers and injures his left foot. He files a claim for traumatic injury, which is accepted by the OWCP. Two months later, he rolls his desk chair over his left foot and is required to stay home once again. What kind of claim would this be and what form(s) should be issued?</p>\r\n<p>Although the injury involves the same foot it would be classified as a new injury since the injury is caused by another event. Happened in a single work shift, new chromatic copy, issue a CA-1. Is this answer, True or False?\r\n</p>', 74);
INSERT INTO `sb_question` VALUES(6, '<p><b><i>Question 3:</i></b></p>\r\n\r\n<p>A Deputy Clerk in the Maryland District Court is asked to take six large boxes of case files to the Federal Records Center. He does so. That night he develops severe back pain. He sees his physician who tells him that his condition is directly related to lifting the heavy boxes the day before. What type of claim should be filed? \r\n</p>\r\n', 75);
INSERT INTO `sb_question` VALUES(7, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>For practical purposes, an occupational illness/disease is any reported condition which does not meet the definition of a traumatic injury.\r\n</p>', 83);
INSERT INTO `sb_question` VALUES(8, '<br><br>\r\n<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>With respect to Occupational Diseases, the CA-2 form, is one of the forms that the employee and supervisor is required to complete.\r\n</p>', 84);
INSERT INTO `sb_question` VALUES(9, '<br><br>\r\n<p><b><i>Question 3:</i></b></p>\r\n\r\n<p>Select the parts of the CA-2 form the employee (or person acting on the employee?s behalf) is required to fill out:\r\n</p>', 85);
INSERT INTO `sb_question` VALUES(10, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>With respect to Recurrences, the CA-2a form, is one of the forms that the employee and supervisor is required to complete.</p>', 91);
INSERT INTO `sb_question` VALUES(11, '<br><br>\r\n<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>For a supervisor, it is important to listen \r\ncarefully to the employee''s explanation before making a determination regarding the situation. \r\n It may be a recurrence or it may be a new injury.\r\n</p>', 92);
INSERT INTO `sb_question` VALUES(12, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>Regarding medical benefits, Compensation will be paid for first aid, medical treatment, hospitalization, and expenses for travel to obtain medical treatment, as well as for any prescription drug, appliance or other supplies directed for use by a qualified physician.\r\n</p>', 127);
INSERT INTO `sb_question` VALUES(13, '<br>\r\n<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>With respect to disability benefits and leave buy back, If an injured employee elects to use sick or annual leave during a period of disability, the employee may at a later date, buy back the leave used.  A buy back permits the employee to reinstate leave used due to a work-related injury or disease.  </p>', 128);
INSERT INTO `sb_question` VALUES(14, '<br>\r\n<p><b><i>Question 3:</i></b></p>\r\n\r\n\r\n<p>With regard to disability benefits and schedule award, which of the following is true:\r\n</p>', 129);
INSERT INTO `sb_question` VALUES(15, '<p><b><i>Question 1:</i></b></p>\r\n\r\n<p>The survivors of a Federal employee whose death is causally related to employment are entitled to benefits in the form of monthly compensation payments, transportation of the remains (if necessary), funeral, and burial expenses up to a maximum of $800.\r\n</p>', 152);
INSERT INTO `sb_question` VALUES(16, '<br>\r\n<p><b><i>Question 2:</i></b></p>\r\n\r\n<p>A third party claim is defined as ?when an injury or death for which benefits are payable under the Federal Employees? Compensation Act (FECA) is caused under circumstances that create a legal liability upon some  person or persons other than the United States Federal Government to pay damages.?</p>', 153);
INSERT INTO `sb_question` VALUES(17, '<br>\r\n<p><b><i>Question 3:</i></b></p>\r\n\r\n<p>Employees who are directly engaged in performing the duties of their jobs are covered by the FECA, regardless of whether the work is performed at the court unit building or at an alternative worksite.  However, when an employee is on property under his or her own control, activities which are not immediately directed toward the actual performance of regular duties do not arise out of employment. \r\n</p>', 154);
